          <Route path = "/" element = {<PetList />} />
          <Route path="/new" element={<NewPet />} />
          <Route path = "/pet/:id" element = {<Pet />} />
          <Route path = "/pet/edit/:id" element = {<EditPet />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
